package com.study.interview.stringManipulation;

import com.study.quiz.Quiz;

import java.io.BufferedWriter;
import java.io.IOException;
import java.util.*;

public class SherlockAndTheValidString extends Quiz {

    /**
     * Sherlock considers a string to be valid if all characters of the string appear the same number of times.
     * It is also valid if he can remove just 1 character at 1 index in the string, and the remaining characters will occur the same number of times.
     * Given a string [s], determine if it is valid. If so, return YES, otherwise return NO.
     *
     * <p>
     * <p>
     * 1. 모든 문자는 같은 수가 반복되어야함.
     * 2. 반복수가 일치하지 않는 수에서 1개의 숫자는 제거하여 맞출 수 있다.
     * <p>
     * ex) abcc
     * a:1, b:1, c:2 개 이지만 c 의 값 하나를 제거하여 모든 수를 각 1개씩으로 맞출 수 있음.
     * <p>
     * ex) aaaabbcc
     * a:4, b:2, c:2 이며 a 가 4 개 이기때문에 하나를 제거해도 a:3 으로 b , c 와 같이 2 개가 되지 않기 떄문에 변경 불가
     *
     * @param s
     * @return
     */
    static String isValid(String s) {
        s = s.trim();
        HashMap<Character, Integer> hm = new HashMap<>();
        for (char ch : s.toCharArray()) {
            if (!hm.containsKey(ch)) {
                hm.put(ch, 1);
            } else {
                int sum = hm.get(ch) + 1;
                hm.put(ch, sum);
            }
        }

        // 가장많은 수 외에 2개 이상이면 제거
        Iterator<Character> it = hm.keySet().iterator();

        HashMap<Integer, Integer> groupByCountMap = getGroupByCountMap(hm, it);

        if (groupByCountMap.keySet().isEmpty()) {
            return "NO";
        }

        if (groupByCountMap.size() > 2) {
            return "NO";
        }

        if (groupByCountMap.keySet().size() == 1) {
            return "YES";
        }

        Integer firstKey = null;
        Integer firstCount = null;

        Iterator<Integer> iterator = groupByCountMap.keySet().iterator();
        // aaaabbcc 문자가 있는경우 groupByCountMap 에는 4(a),2(b),2(c) => 4개 중복 1, 2개 중복 2개 { 4:1, 2:2 } 로 생성됨
        while (iterator.hasNext()) {
            Integer key = iterator.next();
            Integer count = groupByCountMap.get(key);
            if (firstKey == null) {
                // 기준값 채워넣기
                firstKey = key;
                firstCount = count;
            } else {
                if (firstCount > count) {
                    int i = key - count;
                    if (i == 0 || i == firstKey) {
                        return "YES";
                    }
                    return "NO";
                } else {
                    int i = firstKey - firstCount;
                    if (i == 0 || i == key) {
                        return "YES";
                    }
                    return "NO";
                }
            }
        }
        return "NO";
    }

    private static HashMap<Integer, Integer> getGroupByCountMap(HashMap<Character, Integer> hm, Iterator<Character> it) {
        HashMap<Integer, Integer> vHm = new HashMap<>();
        while (it.hasNext()) {
            Character ch = it.next();
            Integer v = hm.get(ch);
            if (!vHm.containsKey(v)) {
                vHm.put(v, 1);
            } else {
                int sum = vHm.get(v) + 1;
                vHm.put(v, sum);
            }
        }
        return vHm;
    }

    private static final Scanner scanner = new Scanner(System.in);

    public static void main(String[] args) throws IOException {
        BufferedWriter bufferedWriter = getBufferedWriter();
        String s = scanner.nextLine();

        String result = isValid(s);

        bufferedWriter.write(result);
        bufferedWriter.newLine();

        bufferedWriter.close();

        scanner.close();
    }

    private static List<String> getInputs() {
        List<String> list = new ArrayList<>();
        list.add("aaaabbcc"); // NO
        list.add("abcc");  // YES
        list.add("abccc"); // NO
        list.add("aabbcd"); // NO
        list.add("aabbccddeefghi"); // NO
        list.add("abcdefghhgfedecba"); // YES
        // 아래 테스트 String 은 파일에서 읽지 않으면 에러발생 input.txt 파일에서 읽어 테스트 할 것. 테스트 결과는 YES 가 나와야함.
        // list.add("");
        // list.add(readLineByLine(System.getenv("PWD") + File.separator + "input.txt"));
        return list;
    }
}
